function animate() {
    if (!this.running) return;

 	requestAnimationFrame( this.animate.bind(this) );	// line up the next one before we start calculating

    var world = this.box2dWorld;
    world.Step(
               1 / 60   //frame-rate
            ,  10       //velocity iterations
            ,  10       //position iterations
         );
     world.DrawDebugData();
     world.ClearForces();

}

